import React from "react";
import "../css/Home.css";

function Home() {
  return (
    <div className="home">
      <div className="home-title">
        <h1>HighQ</h1>
      </div>
      <div className="home-motto">
        <h4>Lorem Ipsum Lorem Ipsum</h4>
      </div>
    </div>
  );
}

export default Home;
